import React from 'react'
import { Container, Row } from 'react-bootstrap';

const Profile = () => {    
  const user = useSelector(state => state.user);
    return(
            <Container>
                <Row>
                    <h3 className="my-5">Welcome to your Profile {user.firstName} {user.lastName}</h3>
                </Row>
            </Container>
        
    )
}

export default Profile
